import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import { Routes, Route, BrowserRouter } from "react-router-dom";

import { Landing } from "./components/Landing";
import { Study3 } from "./components/questions/Study3";
import { Study4 } from "./components/questions/Study4";
import { Study7 } from "./components/questions/Study7";
import { Study11 } from "./components/questions/Study11";
import { Study15 } from "./components/questions/Study15";
import { Study19 } from "./components/questions/Study19";
import { Study20 } from "./components/questions/Study20";
import { Study21 } from "./components/questions/Study21";

import { Info } from "./components/info/components/Info";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* <Route exact path="/" element={<Landing />} /> */}
        <Route
          exact
          path="/"
          element={
            <Info
              title={
                "Miksi et halua tehdä juttua polarisoivasta aiheesta? Minkälaista apua kaipaat polarisoivan aiheen käsittelyyn?​​​​​​"
              }
              options={[
                {
                  value:
                    "Yleisön reaktio pelottaa. Kaipaan tukea palautevyöryn käsittelemisessä.​​​​",
                  navigate: "study/23",
                },
                {
                  value:
                    "Kaipaan tukea ja ohjeistusta moniäänisempien juttujen tekemiseen.​​​​​",
                  navigate: "study/24",
                },
                {
                  value:
                    "Kaipaan lisää aikaa ja muita resursseja polarisoivan aiheen käsittelyyn.​​​​​",
                  navigate: "study/25",
                },
                {
                  value:
                    "On haastavaa löytää monipuolisia ja moniäänisiä uskottavia lähteitä.​​​​​",
                  navigate: "study/22",
                },
                {
                  value:
                    "Pelkään, että uskottavuuteni kärsii, jos tuon esiin valtavirrasta poikkeavia näkökulmia esiin.​​​​​",
                  navigate: "study/26",
                },
              ]}
            />
          }
        />
        <Route path="/study/3" element={<Study3 />} />
        <Route path="/study/4" element={<Study4 />} />
        <Route path="/study/7" element={<Study7 />} />
        <Route path="/study/11" element={<Study11 />} />
        <Route path="/study/15" element={<Study15 />} />
        <Route path="/study/19" element={<Study19 />} />
        <Route path="/study/20" element={<Study20 />} />
        <Route path="/study/21" element={<Study21 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
